            return False

    def is_valid_string(input_string, grammar_dict):
        if not input_string:
            return True

        # Check if the input string is in the grammar
        if not is_valid(grammar_dict, input_string):
            return False

        return True

    def parse(grammar, input_string):
        try:
            result = parse_tree(grammar, input_string)
            return result
        except Exception as e:
            print(f"An error occurred: {e}")
            return None

    def parse_tree(grammar, input_string):
        try:
            result = parse_tree_helper(grammar, input_string)
            return result
        except Exception as e:
            print(f"An error occurred: {e}")
            return None

    def parse_tree_helper(grammar, input_string):
        result = {}
        for symbol in input_string:
            if symbol not in result:
                result[symbol] = None
            else:
                result[symbol] = result[symbol] + 1
        return result


    # Test the string with the grammar
    result = solve()
    print(result)

